        title:"Trendy Fuision Delights"
    },
    {
        img5:"https://www.kindmeal.my/photos/deal/6/628-4921-m.jpg",
        brand5:'https://www.kindmeal.my/photos/shop/5/505-4609-m.               ',
        title:'Japanese Fusion Delights'
    },
    {
        img6:"https://www.kindmeal.my/photos/deal/4/498-2202-m.jpg",
        brand6:'https://www.kindmeal.my/photos/shop/2/212-2494-m.jpg',
        title:'Imperial Rest,10% off -Implerial firstbColl'
    },
    {
        img7:"https://www.kindmeal.my/photos/deal/6/617-3503-m.jpg",
        brand7:'https://www.kindmeal.my/photos/shop/4/493-3436-m.jpg',
        title:"Earth Friendly Meals,15off -LOovem "
    }
]

let slideIndex = 1;
showSlides(slideIndex);

// Next/previous controls
function plusSlides(n) {
  showSlides(slideIndex += n);
}

// Thumbnail image controls
function currentSlide(n) {
  showSlides(slideIndex = n);
}

function showSlides(n) {
  let i;
  let slides = document.getElementsByClassName("mySlides");
  let dots = document.getElementsByClassName("demo");
  let captionText = document.getElementById("caption");
  if (n > slides.length) {slideIndex = 1}
  if (n < 1) {slideIndex = slides.length}
  for (i = 0; i < slides.length; i++) {
    slides[i].style.display = "none";
  }
  for (i = 0; i < dots.length; i++) {
    dots[i].className = dots[i].className.replace(" active", "");
  }
  slides[slideIndex-1].style.display = "block";
  dots[slideIndex-1].className += " active";
  captionText.innerHTML = dots[slideIndex-1].alt;
}

function Slider(){
    return(
        <div class="container">

  {/* <!-- Full-width images with number text --> */}
        <div class="mySlides">
            <img src="https://www.kindmeal.my/photos/deal/6/683-4718-m.jpg" style="width:100%"/>
        </div>

        <div class="mySlides">
            <img src="https://www.kindmeal.my/photos/deal/6/683-4718-m.jpg" style={{width:"100%"}}/>
        </div>

        <div class="mySlides">
            <img src="https://www.kindmeal.my/photos/deal/6/633-3874-m.jpg" style={{width:"100%"}}/>
        </div>

        <div class="mySlides">
            <img src="https://www.kindmeal.my/photos/deal/6/683-4718-m.jpg" style="width:100%"/>
        </div>

        <div class="mySlides">
            <img src="https://www.kindmeal.my/photos/deal/6/683-4718-m.jpg" style={{width:"100%"}}/>
        </div>

        <div class="mySlides">
            <img src="https://www.kindmeal.my/photos/deal/6/633-3874-m.jpg" style={{width:"100%"}}/>
        </div>

        {/* <!-- Image text --> */}
        <div class="caption-container">
            <p id="caption"></p>
        </div>

    {/* <!-- Thumbnail images --> */}
        <div class="row">
            <div className="column">
            <img class="demo cursor" src="img_woods.jpg" style={{width:"100%"}} onClick="currentSlide(1)" alt="The Woods"/>
            </div>
            <div class="column">
            <img class="demo cursor" src="img_5terre.jpg" style={{width:"100%"}} onClick="currentSlide(2)" alt="Cinque Terre"/>
            </div>
            <div class="column">
            <img class="demo cursor" src="img_mountains.jpg" style={{width:"100%"}} onClick="currentSlide(3)" alt="Mountains and fjords"/>
            </div>
            <div class="column">
            <img class="demo cursor" src="img_lights.jpg" style={{width:"100%"}} onclick="currentSlide(4)" alt="Northern Lights"/>
            </div>
            <div class="column">
            <img class="demo cursor" src="img_nature.jpg" style={{width:"100%"}} onclick="currentSlide(5)" alt="Nature and sunrise"/>
            </div>
            <div class="column">
            <img class="demo cursor" src="img_snow.jpg" style={{width:"100%"}} onclick="currentSlide(6)" alt="Snowy Mountains"/>
            </div>
        </div>
    </div>
    )
}

export default Slider;
